import React from "react";
import { Link } from "react-router-dom";

function Slider(props) {
  return (
    <div id="img-list">
      {props.imgUrl.map((image) => {
        return (
          <div className="slide-img">
            <Link>
              <img src={image} alt="image" />
            </Link>
          </div>
        );
      })}
    </div>
  );
}

export default Slider;
